Nüüdsest maksa kohvi eest nutitelefoniga. Lisa oma pangakaart meie äppi ning:
- Saad 10% kohvikrediiti igalt kohvilt;
- Jälgi kohvikrediidi saldot oma telefonist;
- Saada oma telefonist sõbrale kohv kingituseks (saabub peagi!);
- Leia kiirelt lähim Caffeine’i kohvik;
- Ole kursis värskeimate Caffeine’i uudistega oma telefonis.

Sul pole veel Caffeine’i kohvikaarti? Lisa oma pangakaart äppi ning genereerime sulle automaatselt kliendinumbri.

Kas sul on küsimusi või ettepanekuid? Kirjuta meile app@caffeine.lt

1) Lights can recognize your usual color choices as you operate;
2) Lights can change color with beautiful music rhythm;
3) With timers switch, can be setting lights turn on off on time;
4) Selection of scenario modes with multiple colors;
5) A shake of the mobile phone can change the color of the light;
6) The color change of light can be controlled by sound;
7) The distance of remote control without direction limitation can reach more than 15 meters;
8) Lights can be changed from the photo on the mobile.

With Alcohol Drink Calendar you can easily mark and track days when you had a sudden glass of wine or pine of beer.

Features:
- Easily manage your drinks in Calendar;
- Drink statistics;
- Add your personal types of drinks;
- Choose the occasion of the drinks;
- Choose people and location;
- Spend statistics;
- Several calendar skins;
- Several currencies;
- Multilanguage;
- Achievements.

And lots more coming!

Drink. Track. Enjoy!


